import React, { useState } from 'react';
import { Nav, NavItem, Dropdown, DropdownItem, DropdownToggle, DropdownMenu, NavLink } from 'reactstrap';
import './nav.css';
import Icon from './../CartIcon/CartonIcon.js';
import Shop from './../CartIcon/Shop.js';
import { Badge } from 'reactstrap';
import ItemsList from "../../components/Promesa/PromesaAndMap.js";
import './home.css';




const Example = (props) => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggle = () => setDropdownOpen(!dropdownOpen);

  return (
    <div>
      <div className="row navtop">
        <div className="col-6 d-flex align-items-center pl-3">
          <Icon/>
          <p className="tituloNav">Shop Pet </p>
          </div>
          <div className="col-6 d-flex justify-content-end align-items-center pr-5">
            <Shop/>
            <Badge color="secondary">0</Badge>

            </div>
        </div>
      <div className="row navbottom pb-3 pt-3">
        <div className="col-12 d-flex justify-content-center align-items-center">
        <Nav pills >
          <NavItem >
            <NavLink className="buttonav" href="#" active>HOME</NavLink>
          </NavItem>
          <NavItem>
            <NavLink className="itemnav" href="#">PRODUCTOS</NavLink>
          </NavItem>
          <NavItem>
            <NavLink className="itemnav" href="#">CONTACTOS</NavLink>
          </NavItem>
          </Nav>
          </div>
      </div>
      <ItemsList />

  </div>


  );
}

export default Example;
